        try{
            await enviandoCaixaEscolhida(caixa_escolhida)
        }catch{
            console.log('erro ')
        }
    }
    return (
        <div className="tela_jogo">
            <div className="container_botoes">
                {Array.from({ length: 25 }).map((_, index) => (
                    <button
                        key={index}
                        id={`btn-${index}`}
                        value={index}
                        onClick={(e) => console.log(`Clicou no botão de valor: ${e.target.value}`)}
                     />
